import React,{Component} from 'react'
import Search from '../Coponent/Search';
import Navibar from '../Coponent/Navibar';

export default class Home extends Component {
    constructor(props){
        super(props);
        this.state={
            s:{}
        }
        this.handlesearchdata=this.handlesearchdata.bind(this);
        this.handlelogout=this.handlelogout.bind(this);
    }
    handlesearchdata(data){
        this.setState({
            s:data
        });

        this.props.handles(data)
    }
    handlelogout(){
        this.setState({
            loggedinstatus:"not_logged_in"
        })
    }

    render() {
        return (
            <div>
                <Navibar loggedinstatus={this.props.loggedinstatus} handlelogout={this.handlelogout}/>
                <Search handlesearchdata={this.handlesearchdata}/>
            </div>

        );
    }
}
